const Random={float:function(n,t){return n=Math.ceil(n),Math.random()*((t=Math.floor(t))-n+1)+n},int:function(n,t){return Math.floor(Random.float(n,t))},shuffle:function(n){for(let t=n.length-1;t>0;t--){let o=Math.floor(Math.random()*(t+1));[n[t],n[o]]=[n[o],n[t]]}return n},choice:function(n){return"string"==typeof n||Array.isArray(n)?n[Random.int(0,n.length-1)]:`cannot pick from ${typeof n}`},sample:function(n,t){let o=[];n=n.toString();for(let r=0;r<t;r++)o.push(n[Random.int(0,n.length-1)]);return o},stringFromChars:function(n="abc.xyz/123",t=5){let o="";for(let r=0;r<t;r++)o+=n[Random.int(0,n.length-1)];return o},multiFloat:function(n=0,t=1,o=4){let r=[];for(let e=0;e<o;e++)r.push(Random.float(n,t));return r},hex:function(){let n="0123456789ABCDEF",t="#";for(let o=0;o<6;o++)t+=n[Random.int(0,n.length-1)];return t},rgb:function(){return`rgb(${Random.int(0,255)}, ${Random.int(0,255)}, ${Random.int(0,255)})`},hsl:function(){return`hsl(${Random.int(0,360)}, ${Random.int(0,100)}%, ${Random.int(0,100)}%)`}};console.log("Thank you for using Random.js! You can view more of my plugins at https://github.com/Kaamkiya");
